import styled from "styled-components";

export const Container = styled.section`
  max-width: 300px;
  display: flex;
  flex-direction: row;
  margin: 1%;
  border: 1px solid rgb(1, 20, 0);
  padding: 1%;

  img {
    height: 300px;
  }
`;
